constructor(){
    super()
    this.state={
    cloud:data
}
}
render(){
    return(
   this.state.cloud.map((value)=>
    <div className="wrapper">
        <div><img src={houseimg}></img></div>
          <div>
            <p>{value.name}</p>
            <p>{value.place}</p>  
          </div>
        <div className="description">
         <div><img></img><p>{value.room}</p></div>
         <div><img></img><p>{value.room}</p></div>
         <div><img></img><p>{value.room}</p></div>
         <div><img></img><p>{value.room}</p></div>

        </div>


    </div>

   )
    )
}
}
export {House}
